import './App.css';
import Nav from './components/navBar.js';
import Pages from './components/Pages.js';
import Footer from './components/Footer.js';
import {BrowserRouter} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Nav/>
        <Pages/>
        <Footer/>
      </BrowserRouter>
    </div>
  );
}

export default App;
